import {StyleSheet, View, Text, StatusBar, SafeAreaView, Image, Alert, Button} from 'react-native'
import * as React from 'react';
import { MaterialIcons } from '@expo/vector-icons';
import {createNativeStackNavigator} from '@react-navigation/native-stack'
import { NavigationContainer } from '@react-navigation/native';
import { Overview } from '../routes/Overview';


const Stack = createNativeStackNavigator();

export function Progress() {
  const ref = React.useRef(null);
  function Default() {
    return(
      <View>  
        <View style={styles.topLabel}>        
          <Image style={styles.logo}source={{uri:'https://reactnative.dev/img/tiny_logo.png'}}/>           
          <Text style={styles.textLabel}>Progress</Text>
          <MaterialIcons style={styles.account} name="account-circle" size={50} color="black" />
        </View>
        <Text>dff</Text>
        <Button 
          title="Overview"
          color='#2196F3'
          onPress={() => {ref.current && ref.current.navigate('Overview')}}
        /> 
        </View>
      );
  }

  return (
      <View style={{ flex: 1 }}>
        <NavigationContainer independent={true} ref={ref}>
          <Stack.Navigator initialRouteName="Default">
            <Stack.Screen name="Default" component={Default} />
            <Stack.Screen name="Overview" component={Overview} />
          </Stack.Navigator>
        </NavigationContainer>  
      </View>
    )
}

const styles = StyleSheet.create({
  container: {
  flex: 1,
  backgroundColor: '#fff',
  alignItems: 'center'
  },
  topLabel: {
      backgroundColor: '#202c40',
      flexDirection: 'row',
      height: 60 
  },
  logo:{
      width:50,
      height:50
  },
  textLabel: {
      fontSize: 40
  },
  account: {
      
  }
});
